import base64

# Ejemplo de código en Base64

base65_code2 = ""
# Decodificar el código Base64


decoded_data = base64.b64decode(base65_code2)

# Guardar el archivo decodificado
file_path = "archivo.xlsx"  # Ruta y nombre del archivo de salida
with open(file_path, "wb") as file:
    file.write(decoded_data)

print("Archivo guardado correctamente.")